//   let uniqueid = Math.random.toString(16).slice(2)
//   let regobj = { username, Firstname, Lastname,  country, address, zip };
//   if (IsValidate()) {
//   //console.log(regobj);
//   fetch(" http://localhost:3000/checkoutDetails", {
//       method: "POST",
//       headers: { 'content-type': 'application/json' },
//       body: JSON.stringify(regobj)
//   }).then((res) => {
